import { Box, Container, Button } from '@chakra-ui/core'
import styled from '@emotion/styled'
import { FaSignInAlt, BsFillPersonFill } from 'react-icons/fa'

const SignInAndJoin = styled.div`
  height:52px;
  line-height:52px;
  border-left: 1px solid #393939;
  border-right: 1px solid #393939;
  padding: 0 6px;
  float: left;
  color:#FFF
`

export default function Header() {
  return <Box h={52} bgColor="#202020" borderBottom="1px solid #393939">
    <Container h={52} maxW={1200}>
      <SignInAndJoin>
        <Button>登录</Button>
        <Button>注册</Button>
      </SignInAndJoin>
    </Container>
  </Box>
}
